document.addEventListener("DOMContentLoaded",e=>{if(document.getElementById("quiz")){function t(){fetch("http://computing.draxx.me/utilities/current_time").then(e=>e.json()).then(e=>{let t=new Date(e.current_time);var n=targetTime-t;document.getElementById("countdown").innerHTML=Math.floor(n/864e5)+"d "+Math.floor(n%864e5/36e5)+"h "+Math.floor(n%36e5/6e4)+"m "+Math.floor(n%6e4/1e3)+"s ",t>=targetTime&&window.location.assign(`http://computing.draxx.me/quiz/${quiz_id}/${session_id}/end`)}).catch(e=>console.error("Error fetching server time:",e))}setInterval(t,1e3)}else if(document.getElementById("add_quiz")){var n=5;$('input[type="checkbox"]').on("change",function(e){$('input[type="checkbox"]:checked').length>n&&(this.checked=!1)})}});